import NavBar from '../../components/navBar/navBar';
import MenuList from '../../components/menuList/menuList';
import React, { useState , useEffect} from 'react'
import './home.css'

//Página de home con el menú para ir a las aplicaciones de isotracker

const Home = () =>{

    useEffect(() =>{

        setContent(<LoadingScreen progress={"25"}/>)
        setTimeout(() => {
            setContent(<LoadingScreen progress={"75"}/>)
        }, 1000)
        setTimeout(() => {
            setContent(<LoadingScreen progress={"100"}/>)
        }, 2000)
        setTimeout(() => {
            setNavBar(<NavBar onChange={value => setCurrentTab(value)}/>)
            setContent(null)            
        }, 2300);

          
    }, [])

    document.title= process.env.REACT_APP_APP_NAMEPROJ
    document.body.style.zoom = 0.8
    return(
        <body>
            <div>
                <NavBar/>
                <MenuList/>
            </div>
        </body>
    );
};

export default Home;
